T-34: Russian Victory

War Documentary hosted by James Faulkner, published by History Channel broadcasted as part of HC Battle Stations series in 2001 - English narration


Information
------------------------------

The horrifying reality of combat on the Eastern Front is evident in this look at the tank that saved the Motherland. It was the most important weapon mobilized by Russia during World War II. Designed and developed in total secrecy, it entered the fray in 1941 and played a critical role in stopping the advance of Operation Barbarossa. &quot;Battle Stations&quot; uses declassified Soviet footage and interviews with veterans of the Eastern Front to tell the story of the T-34, one of the most successful tanks ever made. Find out how an American engineer, J. Walter Christie, played a key role in its development, and relive some of its epic engagements with the help of dramatic re-enactments. In all, 50,000 T-34s were manufactured during the war, and without them, Russia would likely have fallen to the Germans. A must for any military buff, &quot;T-34: Russian Victory&quot; tells the complete story of the &quot;secret&quot; weapon that dominated the Eastern Front.

-- Extended interview of US Army Ordnance Museum Director William Atwater joined to the film --

